Having gone through this discussion, it's clear that mistakes were made and I'm personally willing to give Sonic the chance to correct them as tidily as possible. I sense that most community members are too.

@crayfishz It's clear that Sonic is not re-launching the token, so I'd say go easy with the constant attacks against Cake & Sonic. If you feel so badly about the $MOTOKO situation, it's probably better to walk away from it all. You may even launch your own drop for Ghost holders if you wish.

@cakemaker I hope you guys the best as you try to fix the situation. Please call for help from dfinity if necessary, especially with code audits. That ought to have been done prior but it's never too late.

However it's ironic that most of us sympathize and wish your team well. You're not always so graceful the way you constantly attack others on X (I assume you're the same person), especially Ludo & the BTC Flower team. I feel that the ICP ecosystem is large enough for all projects to do well without attacking one another. Aside from blatant frauds, all projects on the ICP deserve the chance to do well. Peace y'all!

